        private static Developer CreateDeveloper(vaporContext _context, string name, string avatar, string fileContentType)
        {
            Developer developer = new Developer()
            {
                name = name,
                avatar = avatar,
                fileContentType = fileContentType
            };
            _context.Developer.Add(developer);
            _context.SaveChanges();

            return developer;
        }

        private static User CreateDeveloperUser(vaporContext _context, string username, string password, string developerId)
        {
            User developerUser = new User()
            {
                Username = username,
                Password = password,
                developerID = developerId,
                Type = UserType.Developer
            };
            _context.User.Add(developerUser);
            _context.SaveChanges();

            return developerUser;
        }

        private static Customer CreateCustomer(vaporContext _context, string email, string firstName, string lastName, string phoneNumber, string name)
        {
            Customer customer = new Customer()
            {
                email = email,
                firstName = firstName,
                lastName = lastName,
                phoneNumber = phoneNumber,
                name = name
            };
            _context.Customer.Add(customer);
            _context.SaveChanges();

            return customer;
        }
        private static User CreateCustomerUser(vaporContext _context, string username, string password, string customerId)
        {
            User customerUser = new User()
            {
                Username = username,
                Password = password,
                customerID = customerId,
                Type = UserType.Customer
            };
            _context.User.Add(customerUser);
            _context.SaveChanges();

            return customerUser;
        }

        private static Game CreateGame(vaporContext _context, string developerId, int price, string name, string description, string date, List<Genre> geners)
        {
            Game game = new Game()
            {
                developerId = developerId,
                price = price,
                name = name,
                description = description,
                releaseDate = DateTime.Parse(date),
                genres = geners
            };
            _context.Game.Add(game);
            _context.SaveChanges();

            return game;
        }

